Toasting 🥂 up another amazing year full of blessings and amazing memories! This month I’ve been jam packed with projects, events, and life as we know it! But a couple of weeks ago, I had the honor and privilege of planning the most beautiful and intimate pamper themed birthday celebration for the most deserving lady on the planet, at the beautiful @shinolahotel Detroit, inside the Canfield Suite! I’m so grateful I get to do what I love for some pretty special people! This meant a lot to me for several reasons, that I’ll share at some point, but for now, I just want to enjoy how gorgeous everything turned out! 

Every guest received a satin robe, lush slippers, and a pamper themed gift box! Every detail was planned to make things special for not only the guest of honor, but her friends too! And what pamper party is complete without manicures and pedicures for everyone!?

Special thanks again to my most trusted design partner and floral vendor @eventsbyvte for helping me pull this all together! The florals were gorgeous per usual! From the beginning of the process you were so excited and willing to help me pull this beautiful event together! Thank you for EVERYTHING!

@wardrobe_lover you did such a beautiful job on the charcuterie table! I had to convince everyone to actually eat it!! Lol thank you so much again! 

@tmacsplate the food was delicious!!! That white chicken chilli was nothing to play around with! Thank you for always providing such amazing dishes for my clients!

@thetennailbar thank you for being absolutely incredible!!! The ladies truly enjoyed their experience! Everyone had a blast getting their manicures and pedicures!! I love my friends over at The Ten because they always go above and beyond for me always! 

Thank you to each of you for helping me make this day so special! 

